import { React, useState } from "react"
import { Link } from 'react-router-dom';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import "./Registration.css"
import { validation } from "../assets/scripts/validation";
import { register } from "../assets/scripts/register";

function Registration() {

    function emailChanged(){
        
        document.querySelectorAll(".kiir")[0].innerHTML=validation("email",document.getElementById("email").value)
    }
    function usernameChanged(){
        document.querySelectorAll(".kiir")[1].innerHTML=validation("fnev",document.getElementById("fnev").value)
    }
    function phonenumberChanged(){
        document.getElementById("telefonszamspan").innerHTML=validation("telefonszam",document.getElementById("telefonszam").value)
    }
    function fullNameChanged(){
        document.getElementById("fullnamespan").innerHTML=validation("teljesnev",document.getElementById("teljesnev").value)
    }
    function cityChanged(){
        document.getElementById("telepulesspan").innerHTML=validation("telepules",document.getElementById("telepules").value)
    }
    function passwordChanged(){
        document.getElementById("passwdiv").innerHTML=validation("passwd",document.getElementById("passwd1").value)
    }
    function passwordSameChanged(){
        document.getElementById("passwdsame").innerHTML=validation("repeatpasswd",document.getElementById("passwd2").value)
    }
    function buttonPressed(){
        register()
    }

    return (
        <div className="mainreg" id="main">
            <div id="belso">
                <div>
                    <span className="hatter">E-mail: </span>
                    <input type="email" name="" id="email" className="hatter" onChange={emailChanged} />
                </div>
                <div className="kiir"> <span id="emailspan"></span></div>
                <div>
                    <span className="hatter">Felhasználónév: </span>
                    <input type="text" name="" id="fnev" className="hatter" onChange={usernameChanged} />
                </div>
                <div className="kiir"> <span id="usernamespan">asd</span><span id="a">asd</span></div>
                <div>
                    <span className="hatter">Telefonszám: </span>
                    <input type="text" name="" id="telefonszam" className="hatter" onChange={phonenumberChanged} />
                </div>
                <div className="kiir"> <span id="telefonszamspan"></span></div>
                <div>
                    <span className="hatter">Teljes Név: </span>
                    <input type="text" name="" id="teljesnev" className="hatter" onChange={fullNameChanged} />
                </div>
                <div className="kiir"> <span id="fullnamespan"></span></div>
                <div>
                    <span className="hatter">Település: </span>
                    <input type="text" name="" id="telepules" className="hatter" onChange={cityChanged} />
                </div>
                <div className="kiir"> <span id="telepulesspan"></span></div>
                <div>
                    <span className="hatter">Jelszó: </span>
                    <input type="password" name="" id="passwd1" className="hatter" onChange={passwordChanged} />
                </div>
                <div id="passwdiv" className="kiir"><span id="passwdspan"></span></div>
                <div>
                    <span className="hatter">Jelszó újra: </span>
                    <input type="password" name="" id="passwd2" className="hatter" onChange={passwordSameChanged} />
                </div>
                <div className="kiir"><span id="passwdsame"></span></div>
                <div className="belsodiv">
                    <span className="hatter">Elfogadja a feltétleket?</span>
                    <input type="checkbox" name="" id="cbox" className="hatter" />
                </div>
                <div>
                    <input type="button" value="Regisztrálás" id="submit" className="hatter" onClick={buttonPressed} />
                </div>
            </div>
        </div>
    )
}

export default Registration;
